import React from 'react'
import IconButton from '@material-ui/core/IconButton';
import DeleteIcon from '@material-ui/icons/Delete';




const NoteList = (props) =>{

    return(
        <>
         <ul className = "list">
       {props.title && props.note ? <li><IconButton className = "delete-btn" color="primary"><DeleteIcon/></IconButton><span>{props.title}</span><li>{props.note}</li></li> : null }  
        </ul>     
         
        </>
    )
}


export default NoteList;
